- input: "TEXT\x1CC00443846\x1CX0\x1C\x1CF3A\x1CReport is amended to update beginning
    and ending cash on hand.  Additionally, in response to the RFAI dated December
    23, 2010, the Committee confirms that donors George R. Wilbanks in CT and George
    Wilbanks in VA are two different donors.  The election designations for the prior
    period contributions from Wayne F. Wilbanks have been corrected, and he did not
    make excessive contributions.  As was originally noted in the report, the Committee
    confirms that both Sickles for Delegate and the Southside Area Democratic Women's
    Committee confirmed they had permissable funds at the time of their contributions.
    \ Finally, the detail for the October 15 payroll done via Paychex has been added;
    it was inadvertently omitted from the original report.\n"
